import React, { Component } from 'react';



class Todoitem extends Component {
  
    style = () => {

        if(this.props.todoit.complet){
            return(
                "yes"
            )
        }else{
            return(
                "no"
            )
        }

    }

  render(){
    const { title , id } = this.props.todoit;
    return(
        <div className={this.style()}>
        
        <p> <input type="checkbox" onChange={this.props.changes.bind(this , id)} /> {this.props.todoit.title}</p>
        
       </div>
      

    );
  }
}

export default Todoitem;
